import React, { useEffect, useState } from "react";
import NavBar from "./NavBar";
import Stages from "./Stages";

const Dashboard = ({ setAuth }) => {

	const [ticket, setTicket] = useState("");
	const [business, setBusiness] = useState("");
	const [address, setAddress] = useState("");

  const getProfile = async () => {
		try {
		  const res = await fetch("http://localhost:5000/dashboard/", {
		    method: "GET",
		    headers: { jwt_token: localStorage.token }
		});
		 //console.log(parseData);
		 const parseData = await res.json();
		  setTicket(parseData.ticket_num);
		  setBusiness(parseData.user_bus);
		  setAddress(parseData.user_address);
		} catch (err) {
		  console.error(err.message);
		}
	};

	useEffect(() => {
    getProfile();
  }, []);

  return (
    <div>
      <NavBar setAuth={setAuth}/>
      <Stages/>
      <div class="welcome">
        <h2>Welcome to the loan Portal</h2>
      </div>
      <div class="container">
        <div class= "box">
          <h4>Business Profile</h4>
          <hr size="2" width="40%" color="red"/>  
          <p id="red"> Application Number: #{ticket}</p>
          <p id="bold"> {business}</p>
          <p> {address}</p>
        </div>
        <div class= "box">
          <h4>Status</h4>
        </div>
        <div class= "box">
          <h4>Your Quote</h4>
        </div>
      </div>
      <div>
        Test {business}
      </div>
    </div>
  );
};

export default Dashboard;
